import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom'; // Обратите внимание на Routes
import './styles/style.css'
function App() {
    return(
<Router>
      <div>
        <h5>Магазин Текстиль</h5>
        <a><Link>Мы </Link></a>
        <a><Link>Мы</Link></a>
        <a><Link>Мы</Link></a>
        <hr></hr>
      </div>
    </Router>
    );
}

export default App;
